import React from 'react';
import styled from 'styled-components';
import FacultyButtons from './FacultyButtons';

const Container = styled.div`
  /* Add your WelcomingPage styles here */
`;

const WelcomingPage = ({ setSelectedFaculty }) => {
  return (
    <Container>
      <h1>Welcome to our University!</h1>
      <p>Explore our faculties and subjects below:</p>
      <FacultyButtons setSelectedFaculty={setSelectedFaculty} />
    </Container>
  );
};

export default WelcomingPage;
